(1, 17, , 'Hoysaleswara temple, also referred simply as the Halebidu temple, is a 12th-century Hindu temple dedicated to Shiva. It is the largest monument in Halebidu, a town in the state of Karnataka, India and the former capital of the Hoysala Empire.');
INSERT INTO `location_images` (`id`, `loc_id`, `images`, `details`) VALUES
(2, 16, , 'Shettihalli Church is located 2 km from Shettihalli, Hassan, in Karnataka. Built in the 1860s by the French missionaries in India, the church is a magnificent structure of Gothic Architecture. After the construction of the Hemavati Dam and Reservoir in 1960 the church was abandoned'),
(3, 19, , 'Hampi is an ancient village in the south Indian state of Karnataka. It’s dotted with numerous ruined temple complexes from the Vijayanagara Empire. On the south bank of the River Tungabhadra is the 7th-century Hindu Virupaksha Temple, near the revived Hampi Bazaar. A carved stone chariot stands in front of the huge Vittala Temple site. Southeast of Hampi, Daroji Bear Sanctuary is home to the Indian sloth bear.');

